Sobaka tells the classic story of an immigrant chasing the American Dream. Boris Kievsky stars as a Russian housekeeper yearning for a better life for himself and his ill sister while unknowingly working for a hitman in Los Angeles. With the aid of a devious call girl he hatches a plan to rob his dangerous boss (Turkish star Murat Han). When the robbery goes wrong he finds his choices have set him down a
dark path into a deadly world.

Please support independent film by purchasing the DVD at Amazon or on the link at clearlyambiguousfilm.com.
